import React, { Component, useState, useEffect } from "react";
import { Map, GoogleApiWrapper } from "google-maps-react";
import { Route } from "react-router-dom";
import { HashRouter } from "react-router-dom";
import { NavLink } from "react-router-dom";
import PropTypes from 'prop-types';
import clsx from 'clsx';
import axios from "axios";

const mapStyles = {
  width: '50%',
  height: '50%'
};

class Grocery extends React.Component {

  static defaultProps = {
    center: {
      lat: 59.95,
      lng: 30.33
    },
    zoom: 11
  }; 

  constructor (props) {
    super(props)
    this.state = {
      data: [],
      results: []
     };
    this.onSort = this.onSort.bind(this)
  }

  state = {
    CityName: ""

  }
  componentDidMount() {
    const request_headers = {
      headers: {
        "PRIVATE-TOKEN": "AGN7CEcDXss1xRubmb2F"
      }
    };

    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    const cityUrl = "http://localhost:5000/api/City/1";
    axios.get(proxyurl + cityUrl, request_headers) 
      .then(res => {
        for (const property in res.data) {
          const cur = res.data[property];
          this.setState({ CityName: this.state.cur.cities[0].name }); 
          console.log(cur.cities[0].name);

        }


      })
      .catch(err => {
        console.log(err);
      });

    fetch(proxyurl + cityUrl)
      .then(function(response) {
        return response.json();
      })
      .then(items => this.setState({data: items}));
  }

  onSort(event, sortKey) {
    const data = this.state.data;
    data.sort((a, b) => a[sortKey].localeCompare(b[sortKey]))
    this.setState({data})
  }


  render() {
  // Option 1: var data = this.getCities()   <th onClick = {e => this.onSort(e, 'name')}>{{data}}</th> 

  return (
    <div class = "grocery-container">
        <table className = "m-table">
        <thead>
          <th onClick = {e => this.onSort(e, 'name')}> Name </th>
          <th onClick = {e => this.onSort(e, 'address')}>Address</th>
          <th onClick = {e => this.onSort(e, 'phoneNumber')}>Phone Number</th>
          <th onClick = {e => this.onSort(e, 'website')}>Website</th>
          <th onClick = {e => this.onSort(e, 'hours')}>Hours</th>
        </thead>

        <tbody>
          <td data-title="Name">{this.state.CityName}</td>
        </tbody>

        {/* <tbody>
          {newdata.map(function(hospital, index) {
            return (
              <tr key={index} data-item={hospital}>
                <td data-title="Name">{hospital.name}</td>
                <td data-title="Address">{hospital.address}</td>
                <td data-title="Phone Number">{hospital.phoneNumber}</td>
                <td data-title="Website">{hospital.website}</td>
                <td data-title="Hours">{hospital.hours}</td>
              </tr>
            );
          })}
        </tbody>  */}

      </table>  

      <Map
          google={this.props.google}
          zoom={8}
          style={mapStyles}
          initialCenter={{ lat: 47.444, lng: -122.176}}
        />
      </div> 
  );
}
}

